CREATE TABLE IF NOT EXISTS `bird_data` (
`id` INT NULL,
`altitude` INT NULL,
`date_time` VARCHAR(20) NULL,
`date` VARCHAR(20) NULL,
`device_info_serial` INT NULL,
`direction` VARCHAR(20) NULL,
`latitude` FLOAT NULL,
`longitude` FLOAT NULL,
`speed_2d` VARCHAR(20) NULL,
`bird_name` VARCHAR(20) NULL,
`nearest_city` VARCHAR(20) NULL,
`country` VARCHAR(20) NULL
);

